require 'set'

def length_of_longest_substring str
  return str.size if str.size < 2
  
  left = right = longest = 0
  counts = Hash.new { |_| 0 }
  
  counts[str[left]] += 1
  
  until right == str.size-1 do
    right += 1
    counts[str[right]] += 1
    until counts[str[right]] <= 1 do
      counts[str[left]] -= 1
      left += 1
    end
    longest = [(left..right).size, longest].max
  end
  
  longest
end

